import React from "react";
import { Formik, Form, Field, ErrorMessage } from "formik";
import * as Yup from "yup";

function SignUp(props) {
  const handleLeaveClick = () => {
    props.setOpenSignIn(false);
    props.setOpenSignUp(false);
  };

  const initialValue = {
    username: "",
    password: "",
  };

  const validationSchema = Yup.object().shape({
    username: Yup.string().min(3).max(10).required(),
    password: Yup.string().min(3).max(10).required(),
  });

  const onSubmit = (data) => {
    console.log(data);
  };

  return (
    <Formik
      initialValues={initialValue}
      onSubmit={onSubmit}
      validationSchema={validationSchema}
    >
      <Form className="SignArea">
        <button
          className="SignLeave"
          onClick={() => {
            handleLeaveClick();
          }}
        >
          X
        </button>
        <ErrorMessage
          name="username"
          component="span"
          className="SignErrorMessage"
        />
        <Field
          className="SignUsername"
          name="username"
          placeholder="Username..."
        ></Field>
        <ErrorMessage
          name="password"
          component="span"
          className="SignErrorMessage"
        />
        <Field
          className="SignPassword"
          name="password"
          placeholder="Password..."
        ></Field>
        <button className="SignButtons" type="submit">
          Sign Up
        </button>
      </Form>
    </Formik>
    /*<div className="Sign">
      <div className="SignArea">
        <button
          className="SignLeave"
          onClick={() => {
            handleLeaveClick();
          }}
        >
          X
        </button>
